import React from 'react';
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import PageCaptionSpacer from "../common/PageCaptionSpacer";
import Typography from "@material-ui/core/Typography";


function CompFormContainer() {

    return (
        <SecondaryLayout>
            <PageCaptionSpacer/>

            <SuggestWrapper maxWidth="xl">
                <InnerFormSpacer>

                    <Typography component="h1" variant="h5" align="center" color="textPrimary">
                        Письмо дизайнеру
                    </Typography>
                    <SuggestForm/>
                    <ButtonsGroup>
                        <Btn variant="contained">Предложить</Btn>
                    </ButtonsGroup>

                </InnerFormSpacer>
            </SuggestWrapper>

        </SecondaryLayout>
    );
}

export default CompFormContainer
